{
  "name": "UBX-TIM-HOC",
  "class_id": "0x0D",
  "message_id": "0x17",
  "message_type": "input",
  "description": "Host oscillator control",
  "payload_length": {
    "fixed": 8
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "version",
      "data_type": "U1",
      "fixed_value": 0,
      "description": "Message version (0x00 for this version)"
    },
    {
      "byte_offset": 1,
      "name": "oscId",
      "data_type": "U1",
      "description": "Id of oscillator: 0: internal oscillator, 1: external oscillator"
    },
    {
      "byte_offset": 2,
      "name": "flags",
      "data_type": "U1",
      "description": "Flags (see graphic below)"
    },
    {
      "byte_offset": 3,
      "name": "reserved1",
      "data_type": "U1",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "name": "value",
      "data_type": "I4",
      "scale": {
        "multiplier": 0.00390625,
        "raw_string": "2^-8"
      },
      "unit": "ppb",
      "description": "Required frequency offset or raw output, depending on the flags"
    }
  ]
}
